import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../css/Products.css';
import Table from 'react-bootstrap/Table';
import { saveProducts } from '../utils/Common';
import { Link } from 'react-router-dom';
function AllProducts(props) {
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [products, setProducts] = useState([]);
    const [caid, setCaid] = useState(-1)
    useEffect(() => {
        setLoading(true);
        setCaid(props.match.params.caid);
        axios({
            method: 'post',
            url: 'http://127.0.0.1:8000/api/productsbycategory/',
            data: {
              caid: props.match.params.caid
            }
          }).then(
            response => {
              //console.log(response.data)
              setProducts(response.data.products);
              console.log(response.data)
              saveProducts(response.data.products);
              setLoading(false);
            }
          ).catch(
            error => {
              setLoading(false);
              if (error.response.status === 401) setError(error.response.data.message);
              else setError("Something went wrong. Please try again later.");
            }
          )
          
    }, [])


    //console.log(products);
    //const productsArray = JSON.parse(products);
    
    if(loading) {
      return(<div>Loading...</div>)
    }
    else {
    return (

    <div class="Product-Category-Page-Container">

    <div class = "Filter-Box">

      <header class = "Filter-Box-Header">Type</header>

      <div>
        <input type="checkbox"/>
        <label>New</label>
      </div>

      <div>
        <input type="checkbox"/>
        <label>Used</label>
      </div>

      <div>
        <input type="checkbox"/>
        <label>Collectible</label>
      </div>

      <div>
        <input type="checkbox"/>
        <label>Renewed</label>
      </div>

      <header class = "Filter-Box-Header">Type</header>

      <div>
        <span>$0</span>
        <form>
          <input type="range" />
        </form>
        <span>$100</span>
      </div>

      <header class = "Filter-Box-Header">Type</header>

      <form>
        <div>
          <div class="md-form md-outline my-0">
            <input id="from" type="text" class="form-control mb-0"/>
            <label for="form">$ Min</label>
          </div>
          <p class="px-2 mb-0 text-muted"> - </p>
          <div class="md-form md-outline my-0">
            <input id="to" type="text" class="form-control mb-0"/>
            <label for="to">$ Max</label>
          </div>
        </div>
      </form>

    </div>
      <div class = "All-Products-Grid">
          {
          products.map((product) => (
          
            <ul>

              <li><img src={"http://127.0.0.1:8000"+product.image} alt = "Product's Image"></img></li>
              <li><Link to={`/product/${product.pid}`}>{product.name}</Link></li>
              <li>{product.material}</li>
              <li>{product.color}</li>
              <li>{product.stock}</li>
              <li>{product.price}</li>
            
            </ul>

          ))
          }
      </div>
    </div>
  );
  }
}
 
export default AllProducts;
